// SPDX-License-Identifier: MIT
pragma solidity ^0.8.13;

address constant ZERO = 0x0000000000000000000000000000000000000000;

import "./CloneFactory.sol";
import "@openzeppelin/contracts/utils/Strings.sol";

/// @dev child contract MUST implement this interface
/// @dev transferOwnership should accept 0 as the previours owner
interface initableAndOwnerable {
    function init() external;

    function transferOwnership(address newOwner) external;
}

contract Factory is CloneFactory {
    event ContractRegistered(
        string ID,
        address indexed deployAddress,
        address indexed owner
    );
    event ContractDeployed(
        address indexed deployAddress,
        address indexed ownerAddress
    );

    struct ContractTemplate {
        address template;
        address owner;
        address[] deployed;
    }

    mapping(address => address[]) deployer;
    mapping(string => ContractTemplate) contracts;

    function register(string calldata _id, address master) external {
        require(
            contracts[_id].owner == ZERO || contracts[_id].owner == msg.sender,
            "ID Used"
        );
        if (master == ZERO) delete contracts[_id];
        else
            contracts[_id] = ContractTemplate(
                master,
                msg.sender,
                new address[](0)
            );
        emit ContractRegistered(_id, master, msg.sender);
    }

    function deployContract(string calldata _id) external returns (address) {
        address contractTemplate = contracts[_id].template;
        require(contractTemplate != address(0), "No contract template found");

        address child = createClone(contractTemplate);
        initableAndOwnerable(child).init();
        initableAndOwnerable(child).transferOwnership(msg.sender);

        deployer[msg.sender].push(child);
        contracts[_id].deployed.push(child);
        emit ContractDeployed(child, msg.sender);
        return child;
    }

    function getLastDeployed() external view returns (address) {
        address[] storage deployed = deployer[msg.sender];
        return deployed[deployed.length - 1];
    }

    function getLastDeployed(address _owner) external view returns (address) {
        address[] storage deployed = deployer[_owner];
        return deployed[deployed.length - 1];
    }

    function getLastDeployed(string calldata _id)
        external
        view
        returns (address)
    {
        address[] storage deployed = contracts[_id].deployed;
        return deployed[deployed.length - 1];
    }

    function getContractsDeployed() external view returns (address[] memory) {
        return deployer[msg.sender];
    }

    function getContractsDeployed(address _owner)
        external
        view
        returns (address[] memory)
    {
        return deployer[_owner];
    }

    function getContractsDeployed(string calldata _id)
        external
        view
        returns (address[] memory)
    {
        return contracts[_id].deployed;
    }
}
